"   </div>",
"   <div class=\"lgnd\">",
"    The axillary view is taken with the radiograph plate placed on the patients shoulder and the x-ray beam projected through the axilla to the plate. The patient's arm need not be abducted 90&deg;, as this position causes pain. About 10 to 15&deg; of abduction, or just enough to get the x-ray tube between the patient's arm and hip, is usually sufficient.",
