var title_f25_30_26091="ACR RA response criteria";
var content_f25_30_26091=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F64036&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F64036&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American College of Rheumatology 20 percent improvement criteria (ACR20)",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        At least 20 percent&nbsp;improvement in",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Swollen joint counts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. tender joint count",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        and&nbsp;three of the following&nbsp;five variables:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Patient assessed global disease activity (eg, by VAS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Evaluator assessed global disease activity (eg, by VAS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Patient pain assessment (eg, by VAS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Functional disability (eg, by HAQ)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Acute phase response (ESR or CRP)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    A 50 percent&nbsp;and 70 percent&nbsp;ACR response (ACR50 and ACR70, respectively)&nbsp;represents respective improvement of at least 50 perecent&nbsp;or at least 70 percent.",
"    <sup>",
"     [2]",
"    </sup>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Felson, DT, Anderson, JJ, Boers, M, Bombardier, C, et al. American College of Rheumatology preliminary definition of improvement in rheumatoid arthritis. Arthritis Rheum 1995; 38:727.",
"       </li>",
"       <li>",
"        Felson, DT, Anderson, JJ, Lange, ML, et al. Should improvement in rheumatoid arthritis clinical trials be defined as fifty percent or seventy percent improvement in core set measures, rather than twenty percent?. Arthritis Rheum 1998; 41:1564.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
